package com.xzz.sandbox;

public class SolutionDistinctSubsequence {
	
	private Integer numCache[][];
	
	public int numDistinct(String S, String T) {
		char[] chars = S.toCharArray();
		char[] chart = T.toCharArray();
		int[][] numMap = new int[S.length() + 1][T.length() + 1];
		for(int i = 0; i <= T.length(); ++i){
			numMap[S.length()][i] = 0;
		}
		for(int i = 0; i <= S.length(); ++i){
			numMap[i][T.length()] = 1;
		}
		for(int is = S.length() - 1; is >= 0; --is){
			for(int it = T.length() - 1; it >= 0 ; --it){
				if(chars[is] == chart[it]){
					numMap[is][it] = numMap[is + 1][it] + numMap[is + 1][it + 1];
				}else{
					numMap[is][it] = numMap[is + 1][it];
				}
			}
		}
		return numMap[0][0];
	}
	
	public int recNumDistinct(char[] s, char[] t, int is, int it){
		if(it == t.length){
			return 1;
		}
		if(is == s.length){
			return 0;
		}
		if(s[is] == t[it]){
			return recNumDistinct(s, t, is + 1, it + 1)//take this char 
					+ recNumDistinct(s, t, is + 1, it); //not taking this char
		}else{
			if(is + 1 == s.length)
				return 0;
			if(this.numCache[is+1][it] != null){
				return this.numCache[is+1][it].intValue();
			}
			int retVal = recNumDistinct(s, t, is + 1, it);
			this.numCache[is+1][it] = retVal;
			return retVal;
		}
	}

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		try{
			System.out.println((new SolutionDistinctSubsequence().numDistinct(testData[1][0], testData[2][1])));
		}catch(Exception ex){
			System.out.println(ex.getMessage());
		}
	}

	
	private static final String testData[][] = {
		{"rabbbit","rabbit"},
		{"", "rwmimatmhydhbujebqehjprarwfkoebcxxqfktayaaeheys"}
	};
}
